Description:
            Diamond painting kit for 30x15cm diamond picture.
Ideal present to a family, they can do it together! Small children (who can recognise numbers and letters) can do at a same time!
Ready to send same day after payment.
Toolkit of DIY Diamond Painting
1. Enough resin diamonds;
2. Tweezers (used to clip the diamond);
3. Plastic Plates;
4. Environmental Glue
Instructions of DIY Diamond Painting
1. Open the packaging and take out of the canvas,diamond and tools;
2. Check the code number of diamonds and the corresponding symbol;
3. Put the diamonds into the plastic case.Only uncover the needed area of the adhesive tape to avoid dust onto other glue parts;
4. Stick the diamonds on the corresponding symbol of the canvas by the tweezers;
5.Put the diamond painting in a suitable frame and decorate your house or give it to others as a gift.
NOTICE: The diamond painting we are selling here is Semi-finished product and does NOT include a FRAME! the product will be carefully rolled up in the box and sent out.
About mismatch size and color:
1.The sizes are about cloth and measurements different so size not so accurate and measurements different may be size you measured not the same as we write.
2.Differences in color may be caused by some other reasons such as color reflection in the monitor,lighting,background etc.
